import React from "react";
import Container from "../components/Container";
import Row from "../components/Row";
import Col from "../components/Col";



function SignIn() {
    return (
      <div>
          <h1>Sign</h1>
          <h1>IN</h1>

        <Container style={{ marginTop: 30 }}>
          <Row>
            <Col size="md-12">
              <h1>USERNAME</h1>
              <h1>PASSWORD</h1>
              <h1> LOGIN</h1>
              <h1> SIGN UP</h1>
            </Col>
          </Row>

          <Row>
            <Col size="md-12">


            </Col>
          </Row>
        </Container>
      </div>
    );
  }

  export default SignIn;
